clc;
clear;
Tuning1 = load("Data/M2M3ID_Test4_actuation_uncompensated.mat");
Tuning1 = Tuning1.data;
%%
% Search for testing times via force plate z readings:
FPz = Tuning1{3}.Values;

Start_times = [];
End_times = [];
valid = false;
for i =1:length(FPz.Data)
    if valid
        if FPz.Data(i)>-5
            End_times = [End_times, FPz.Time(i)]; % Chop off the robot being picked up
            valid = false;
        end    
    else
        if FPz.Data(i)<-30
            Start_times = [Start_times, FPz.Time(i)];% Chop off the robot being put down
            valid = true;
        end
    end
end
End_times(5) = End_times(5) -10; % Strange artifact at the end of final sample - something went wring with lifting off the force plate.
%%
% Torques calculated via force plate forces using the jacobian, 

FPy = [];
FPz = [];
MRq = [];
MLq = [];
MRt_read = [];
MLt_read = [];
MRt_cmd = [];
MLt_cmd = [];
ts = 1000;
Start_times =int32(Start_times*ts);
End_times = int32(End_times*ts);



% Resamples
MR_q_resample = resample(Tuning1{5}.Values.q, Tuning1{1}.Values.Time);
ML_q_resample = resample(Tuning1{6}.Values.q, Tuning1{1}.Values.Time);
MR_t_resample = resample(Tuning1{5}.Values.t, Tuning1{1}.Values.Time);
ML_t_resample = resample(Tuning1{6}.Values.t, Tuning1{1}.Values.Time);
MR_t_cmd_resample = resample(Tuning1{9}.Values.tff, Tuning1{1}.Values.Time);
ML_t_cmd_resample = resample(Tuning1{8}.Values.tff, Tuning1{1}.Values.Time);
for i = 1:length(Start_times)
    % Force plate
    FPy = [FPy; Tuning1{2}.Values.Data(Start_times(i): End_times(i))];
    FPz = [FPz; Tuning1{3}.Values.Data(Start_times(i): End_times(i))];
    % Motor angles
    
    MRq = [MRq; MR_q_resample.Data(Start_times(i): End_times(i))];
    MLq = [MLq; ML_q_resample.Data(Start_times(i): End_times(i))];

    % Motor torques (cmd)
    
    MRt_cmd = [MRt_cmd; MR_t_cmd_resample.Data(Start_times(i): End_times(i))]; 
    MLt_cmd = [MLt_cmd; ML_t_cmd_resample.Data(Start_times(i): End_times(i))];
    
    % Motor torques (read)
   
    MRt_read = [MRt_read; MR_t_resample.Data(Start_times(i): End_times(i))];
    MLt_read = [MLt_read; ML_t_resample.Data(Start_times(i): End_times(i))];

end
clear MR_q_resample ML_q_resample MR_t_resample ML_t_resample MR_t_cmd_resample ML_t_cmd_resample

%%
%[text] ## Transfer force plate data into torques
% From the side of forces:
Fy_cmd = [];
Fz_cmd = [];
Fy_read = [];
Fz_read = [];
FP_tl = [];
FP_tr = [];
[J11, J12, J21, J22] = BalekaJacobianXY(MLq, MRq);
for i = 1:length(MLt_cmd)
    Jxy = [J11(i), J12(i); J21(i), J22(i)];
    JTxy = Jxy';

    FP_t = JTxy*[FPy(i); FPz(i)];
    FP_tl = [FP_tl, FP_t(1)];
    FP_tr = [FP_tr, FP_t(2)];

    % F_cmd = JTxy\[MLt_cmd(i); MRt_cmd(i)];
    % Fy_cmd = [Fy_cmd; -F_cmd(1)];
    % Fz_cmd = [Fz_cmd; -F_cmd(2)];
    % 
    % F_read = JTxy\[MLt_read(i)*9*0.198; MRt_read(i)*9*0.198];
    % Fy_read = [Fy_read; -F_read(1)];
    % Fz_read = [Fz_read; -F_read(2)];
end
clear F_cmd F_read i J11 J12 J22 J21 times ts JTxy Jxy

%%
t1 = 10000;
t2 = 30000;
linwidth = 1.5;
t = linspace(0, length(FP_tl(t1:t2))/1000, length(FP_tl(t1:t2)));
plot(t, FP_tl(t1:t2), LineWidth=linwidth, LineStyle='-', Color='#BB5566') %[output:216708e1]
hold on %[output:216708e1]
plot(t, MLt_cmd(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488') %[output:216708e1]
% plot(t, MLt_read, LineWidth=linwidth, LineStyle='--', Color='#004488' )
legend('Force plate measurement', 'Motor commanded torque'); %[output:216708e1]
title('Sample of uncompensated left (M2) actuation torques') %[output:216708e1]
axis([0 20 -inf inf]) %[output:216708e1]
xlabel("Time (s)") %[output:216708e1]
ylabel("Torque (Nm)") %[output:216708e1]
hold off %[output:216708e1]

linwidth = 1.5;
t = linspace(0, length(FP_tr(t1:t2))/1000, length(FP_tr(t1:t2)));
plot(t, FP_tr(t1:t2), LineWidth=linwidth, LineStyle='-', Color='#BB5566') %[output:66578fd4]
hold on %[output:66578fd4]
plot(t, MRt_cmd(t1:t2), LineWidth=linwidth, LineStyle='--', Color='#004488') %[output:66578fd4]
% plot(t, MRt_read, LineWidth=linwidth, LineStyle='--', Color='#004488' )
legend('Force plate measurement', 'Motor commanded torque'); %[output:66578fd4]
title('Sample of uncompensated right (M3) actuation torques') %[output:66578fd4]
axis([0 20 -inf inf]) %[output:66578fd4]
xlabel("Time (s)") %[output:66578fd4]
ylabel("Torque (Nm)") %[output:66578fd4]
hold off %[output:66578fd4]
%%
x = [FP_tl, FP_tr];
y = [MLt_cmd; MRt_cmd]';
%Motor command compensation
plot(y, 'b'); %[output:83a8c33c]
hold on %[output:83a8c33c]
plot(x, 'r'); %[output:83a8c33c]
legend("cmd", "meas") %[output:83a8c33c]
hold off %[output:83a8c33c]
% Line of best fit

m1L_M2 = FP_tl(:)\MLt_cmd(:) %[output:7d410f72]
RsqL = corrcoef(FP_tl, MLt_cmd).^2 %[output:1502d0e2]
percentErrorTorquesLM2 = mean(abs((MLt_cmd' - FP_tl)./FP_tl)*100) %[output:38d2c3e1]
MSETorquesLM2 = mean((MLt_cmd' - FP_tl).^2) %[output:52eea9ae]
% [coeff, Sc] = polyfit(x,y, 1);
xFitL = linspace(min(FP_tl), max(MLt_cmd), 1000);
yFitL = polyval([m1L_M2 0], xFitL);


scatter(FP_tl, MLt_cmd, 'b','filled') %[output:7f334c85]
hold on %[output:7f334c85]
plot(xFitL, yFitL, 'r-', LineWidth=2) %[output:7f334c85]
title("Measured vs commanded torque for the left motor (M2)"); %[output:7f334c85]
ylabel("Motor commanded torque (Nm)"); %[output:7f334c85]
xlabel("Force plate measured torque (Nm)"); %[output:7f334c85]
legend("Measured data", "Line of best fit") %[output:7f334c85]
axis([0 40 -inf inf]) %[output:7f334c85]
hold off %[output:7f334c85]

m1R_M3 = FP_tr(:)\MRt_cmd(:) %[output:1ac898f6]
RsqR = corrcoef(FP_tr, MRt_cmd).^2 %[output:0ec210cd]
percentErrorTorquesR = mean(abs((MRt_cmd' - FP_tr)./FP_tr)*100) %[output:3cf407b3]
MSETorquesRM3 = mean((MRt_cmd' - FP_tr).^2) %[output:37597a4f]
% [coeff, Sc] = polyfit(x,y, 1);
xFitR = linspace(min(FP_tr), max(MRt_cmd), 1000);
yFitR = polyval([m1R_M3 0], xFitR);


scatter(FP_tr, MRt_cmd, 'b','filled') %[output:08a30184]
hold on %[output:08a30184]
plot(xFitR, yFitR, 'r-', LineWidth=2) %[output:08a30184]
title("Measured vs commanded torque for the right motor (M3)"); %[output:08a30184]
ylabel("Motor commanded torque (Nm)"); %[output:08a30184]
xlabel("Force plate measured torque (Nm)"); %[output:08a30184]
axis([-40 0 -inf inf]) %[output:08a30184]
legend("Measured data", "Line of best fit") %[output:08a30184]
hold off %[output:08a30184]
